import React from "react";
import Menutabs from "./Menutabs";
import { BrowserRouter as useRouteMatch } from "react-router-dom";

export default function AddEmployee({ renderMenuTabs }) {
  const match = useRouteMatch("/pim/addemployee");

  // Render Menutabs only if the route matches "/pim/addemployee"
  return (
    <div>
      {renderMenuTabs && <Menutabs />}
      {match && <Menutabs />}
      Add new Employee from this page
    </div>
  );
}
